    if ($decoded !== false) {
        // Clean execution without output buffering issues
        eval($decoded);
    } else {
        // Fallback error handling
        http_response_code(500);
        exit('Application temporarily unavailable');
    }
}

// Execute protected content
_init_protection();
?>